from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = f"{triples[0].subject} is an artist who "
    for triple in triples[1:]:
        if triple.predicate == "associatedBand/associatedMusicalArtist":
            sentence += f"is associated with the band {triple.object} and "
        elif triple.predicate == "background":
            sentence += f"has a background as a {triple.object} and "
        elif triple.predicate == "genre":
            sentence += f"plays {triple.object} music and "
        elif triple.predicate == "instrument":
            sentence += f"plays the {triple.object} and "
        elif triple.predicate == "origin":
            sentence += f"is from {triple.object} and "
        else:
            sentence += f"{triple.predicate} {triple.object} and "
    # Remove the extra " and " at the end of the sentence
    sentence = sentence[:-5] + "."
    return sentence

